import React, {Component} from 'react';
import {Navbar, Nav, Button} from 'react-bootstrap';

export class NavBar extends React.Component {
    render() {
        return (
            <Navbar>
                <Navbar.Brand href="#home">verdancy</Navbar.Brand>
                <Nav className="mr-auto">
                    <Nav.Link href="#advice">advice</Nav.Link>
                    <Nav.Link href="#search">search</Nav.Link>
                    <Nav.Link href="#emissions">my emissions</Nav.Link>
                    <Nav.Link href="#garden">my garden</Nav.Link>
                    <Button className="darkgreen-background">
                        <Nav.Link href="#login">Get Started</Nav.Link>
                    </Button>
                    <Button className="cream-background">
                        <Nav.Link href="#login">Sign In</Nav.Link>
                    </Button>
                </Nav>

            </Navbar>
        )
    }
}
